import React from 'react';

const Layout = ({ children }) => {
  return (
    <div className="bg-midnight">
      {children}
    </div>
  );
};

const Nav = ({ children }) => {
  return (
    <div className="py-4 px-6 text-sm font-medium">
      <ul className="flex space-x-3">
        {children}
      </ul>
    </div>
  );
};
const NavItem = ({ href, isActive, children }) => {
  return (
    <li>
      <a
        href={href}
        className={`block px-3 py-2 rounded-md ${isActive ? 'bg-sky-500 text-white' : 'bg-slate-50'}`}
      >
        {children}
      </a>
    </li>
  );
};
export { Layout, Nav, NavItem};
